        const resultArray = books.filter(book => postMessage.title.includes(e.target.value) || book)
    }
  return (
    <header>
        <form className='Search' onSubmit={handleSubmit}>
            <input className='search_input'
            type='text'
            id='search'
            onChange={handleSubmit}
